        {title: 'Welcome to Hogwarts', body: 'lorem ipsum...', author: 'Albus Dumbledore', id: 2},
        {title: 'Slytherin into her DMs', body: 'lorem ipsum...', author: 'Severus Snape', id: 3}
    ]);
    return ( 
        <div className="Home">
        <BlogList blogs ={blogs} title="All Blogs"/>

        </div>
     );
}
